pub export fn predict(
    input: [*]T,
    input_shape: [*]u32,
    shape_len: u32,
    result: *[*]T,
) void {
    if (log_function) |log| {
        log(@constCast(@ptrCast("Starting prediction...\n")));
    }
    //checks on the input parameters
    if (shape_len == 0) return;
    if (shape_len != 2) return;
    if (input_shape[0] != 1) return;
    if (input_shape[1] != 15) return;
    //computing the size of the input tensor
    var size: u32 = 1;
    for (0..shape_len) |dim_i| {
        size *= input_shape[dim_i];
    }

    //allocating space in memory for the data
    const data = allocator.alloc(T, size) catch return;
    defer allocator.free(data);
    for (0..size) |i| {
        data[i] = input[i]; // Copying input elements
    }

    //converting the shape from [*]u32 to []usize
    const usized_shape: []usize = utils.u32ToUsize(input_shape, shape_len) catch return;
    var tensor_input = Tensor(usize).fromShape(&allocator, @constCast(usized_shape)) catch return;
    defer allocator.free(usized_shape);
    defer tensor_input.deinit();
    for (0..size) |i| {
        tensor_input.data[i] = @intCast(@as(usize, @intFromFloat(input[i])));
    }

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Gather operation...\n")));
    }
    tensMath.gather_lean(
        T, //type
        @constCast(&tensor_embedding_weight), //data tensor
        @constCast(&tensor_input), //indices tensor
        0, //axis
        @constCast(&tensor__embedding_gather_output_0), //output tensor
    ) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running ReduceMean operation...\n")));
    }
    const axes = [_]i64{1};
    tensMath.reduce_mean_lean(T, &tensor__embedding_gather_output_0, &tensor__reducemean_output_0, &axes, false, false) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Gemm operation...\n")));
    }
    tensMath.gemm_lean(T, &tensor__reducemean_output_0, @constCast(&tensor_fc1_weight), @constCast(&tensor_fc1_bias), 1e0, 1e0, false, true, &tensor__fc1_gemm_output_0) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Relu operation...\n")));
    }
    tensMath.ReLU_lean(T, &tensor__fc1_gemm_output_0, &tensor__relu_relu_output_0) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Gemm operation...\n")));
    }
    tensMath.gemm_lean(T, &tensor__relu_relu_output_0, @constCast(&tensor_fc2_weight), @constCast(&tensor_fc2_bias), 1e0, 1e0, false, true, &tensor__fc2_gemm_output_0) catch return;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Running Sigmoid operation...\n")));
    }
    tensMath.sigmoid_lean(T, &tensor__fc2_gemm_output_0, &tensor_output) catch return;
    result.* = tensor_output.data.ptr;

    if (log_function) |log| {
        log(@constCast(@ptrCast("Prediction completed.\n")));
    }
